import React from "react";
import {
  AiFillEnvironment,
  AiFillMail,
  AiFillPhone,
  AiFillHome,
} from "react-icons/ai";
import "./Footer.css";

const Footer = () => {
  return (
    <>
      <section className="Footer_section my-5">
        <div className="container-fluid">
          <div className="row">
            <div className="Col-md-4 col-lg-4 col-12">
              <div className="Footer_logo">
                <img src="images/logo.png" alt="Footer logo" />
              </div>
            </div>
            <div className="col-md-4 col-lg-4 col-12">

            </div>
            <div className="col-md-4 col-lg-4 col-12">

            </div>
          </div>
        </div>
      </section>
    </>
  );
};

export default Footer;
